function Main() {
  const [recipe, setRecipe] = useState({})

  useEffect(() => {
    fetch('www.themealdb.com/api/json/v1/1/random.php')
    .then((res) => res.json())
    .then((json) => {
      setRecipe(json);
    })
    .catch(console.error);
  }, {});

  return (
    <div className="Main">

    </div>
  );
}


export default Main;
